import{_ as o,c as d,a3 as a,o as c}from"./chunks/framework.JX9EV3OY.js";const b=JSON.parse('{"title":"产品相关常见问题","description":"","frontmatter":{},"headers":[],"relativePath":"zh/faq/product-faq.md","filePath":"zh/faq/product-faq.md","lastUpdated":null}'),s={name:"zh/faq/product-faq.md"};function t(r,e,l,i,n,p){return c(),d("div",null,e[0]||(e[0]=[a('<h1 id="产品相关常见问题" tabindex="-1">产品相关常见问题 <a class="header-anchor" href="#产品相关常见问题" aria-label="Permalink to &quot;产品相关常见问题&quot;">​</a></h1><p>欢迎来到 <code>RssTabs</code> 常见问题解答页面！这里列出了本产品相关的常见问题，它可以让您对我们的产品有更好的了解。如果没有找到您需要的答案，请通过 <a href="./about/contact-us.html">联系我们</a> 页面获取帮助。</p><h2 id="什么是-rsstabs" tabindex="-1">什么是 RssTabs？ <a class="header-anchor" href="#什么是-rsstabs" aria-label="Permalink to &quot;什么是 RssTabs？&quot;">​</a></h2><p><code>RssTabs</code> 是一个基于 <code>AI + RSS</code> 技术的信息聚合平台，旨在帮助用户高效管理订阅源、聚合内容，并通过 <code>AI</code> 个性化推荐、<code>AI</code> 摘要、<code>AI</code> 翻译等等一系列有趣的功能优化用户的信息获取体验。</p><p><a href="./../guide/introduction/what-is-it.html">查看更多</a></p><h2 id="什么是-single-feed" tabindex="-1">什么是 Single Feed？ <a class="header-anchor" href="#什么是-single-feed" aria-label="Permalink to &quot;什么是 Single Feed？&quot;">​</a></h2><p>在 <code>RssTabs</code> 中，我们将常规意义上的 <code>RSS</code> 订阅源称为 <code>Single Feed</code>。</p><p><code>Single Feed</code> 的定义是一个单独、不可分割的 <code>RSS</code> 订阅源，在 <code>RssTabs</code> 中，<code>Single Feed</code> 是为用户提供订阅和管理内容的基础单元，它为 <code>Poly Feed</code> 提供基础数据服务。</p><p><a href="./../guide/introduction/single-feed.html">查看更多</a></p><h2 id="什么是-poly-feed" tabindex="-1">什么是 Poly Feed？ <a class="header-anchor" href="#什么是-poly-feed" aria-label="Permalink to &quot;什么是 Poly Feed？&quot;">​</a></h2><p>在 <code>RssTabs</code> 中，我们将多个 <code>RSS</code> 订阅源的聚合源称为 <code>Poly Feed</code>。</p><p>使用 <code>RssTabs</code> 创建 <code>Poly Feed</code>，您可以选择多个 <code>Single Feed</code>，我们提供了上千个 <code>Single Feed</code>，您也可以将自己的 <code>RSS</code> 订阅地址解析成 <code>Single Feed</code> 添加，同时，我们还允许您添加关键词、标签等信息，我们将使用 <code>AI</code> 为您提供更细粒度、更精准的信息。</p><p>当然您也可以解析多个 <code>RSS</code> 订阅源组成的 <code>OPML</code> 文件，或是其他平台导出的 <code>OPML</code> 文件，来创建 <code>Poly Feed</code>。</p><p><a href="./../guide/introduction/poly-feed.html">查看更多</a></p><h2 id="如何正确使用-rsstabs" tabindex="-1">如何正确使用 RssTabs <a class="header-anchor" href="#如何正确使用-rsstabs" aria-label="Permalink to &quot;如何正确使用 RssTabs&quot;">​</a></h2><p>在使用 <code>RssTabs</code> 前，您应该仔细阅读本文档，了解 <code>RssTabs</code> 的功能和使用方法。</p><p>我们鼓励用户创建更多的 <code>Poly Feed</code>，并且将他们公开分享出来。</p><p><code>RssTabs</code> 平台的丰富内容，离不开每一位用户的参与。</p><h2 id="rsstabs-的未来" tabindex="-1">RssTabs 的未来 <a class="header-anchor" href="#rsstabs-的未来" aria-label="Permalink to &quot;RssTabs 的未来&quot;">​</a></h2><p>未来，<code>RssTabs</code> 将继续完善和迭代，为用户提供更好的服务。</p><p>我们会提供更强大的内容推荐算法，结合 <code>AI</code> 深度分析用户偏好。我们也会持续优化支持更多内容类型的聚合（如图像、视频、音频等），以满足更多用户的需求。</p><p>同时，我们将发展社区化功能，让用户能分享、关注 <code>Poly Feed</code> 之外还可以评论点赞，为用户提供更多的互动，甚至未来您可以通过发布 <code>Poly Feed</code> 的方式赚取收益。</p><p><a href="./../guide/introduction/our-vision.html">查看更多</a></p>',23)]))}const u=o(s,[["render",t]]);export{b as __pageData,u as default};
